import React, { Component } from 'react'
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Navbar from 'react-bootstrap/Navbar';
import styles from './Header.css';
import { Link } from 'react-router-dom';

export class Header extends Component {
    render() {
        return (
             <div class="fixed-top">
              <Navbar class='navbar'   expand="lg">
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Container>
                  <Navbar.Collapse id="basic-navbar-nav">
                  <Nav className="ml-auto">
                      <Nav.Link style={{color:'white'}}><Link to='/dashboard'>Home</Link></Nav.Link>
                      <Nav.Link><Link to='/notification'>Notifications</Link></Nav.Link>
                      <NavDropdown style={{color:'white'}} title='Profile'>
                          <NavDropdown.Item>
                            <Link to='/profile'>Profile</Link>
                          </NavDropdown.Item>
                          <NavDropdown.Item>
                            <Link to='/settings'>Settings</Link>
                          </NavDropdown.Item>
                      </NavDropdown>
                      <Nav.Link><Link to='/'>Log Out</Link></Nav.Link>
                  </Nav>
                </Navbar.Collapse>
                </Container>
              </Navbar>
          </div>
        )
    }
}

export default Header
